import { Text, TextInput, View } from "react-native";
import componentsStyle from "../styles/components";

const LabelInput = ({ text, inputRef, onChange, ...properties }) => {
    return (
        <View>
            <Text style={componentsStyle.labelInputText}>{text}:</Text>
            <TextInput
                onChange={event => onChange(event.target.value)}
                ref={inputRef}
                style={componentsStyle.labelInput}
                {...properties}
            />
        </View>
    );
}

export {
    LabelInput
}
